import React, { Component } from "react";

export default class tree extends Component {
  constructor() {
    super();
    this.state = {
      tree: []
    };
  }

  componentDidMount() {
    this.getTrees();
  }

  getTrees = _ => {
    fetch("http://localhost:3001/tree")
      .then(response => response.json())
      .then(response => this.setState({ tree: response.data }))
      .catch(err => console.error(err));
  };

  renderProduct = ({ tree_id , tree_name, tree_type, tree_description }) => (
    <div key={tree_id}>
     <h1> {tree_id}</h1> : {tree_name} <br/> {tree_type} <br/> <h1>{tree_description}</h1><br/>
    </div>
  );

  test = ({tree_desc}) => (
    <div key={tree_desc}>
      <h3>{tree_desc.state[0]}</h3>
    </div>
  )

  render() {
    const { tree } = this.state;
    Console.log(tree);
    return <div>{tree.map( this.renderProduct) }{tree.map(this.test)}</div>;
  }
}
